import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div>
      <h1>1. Overview </h1>
      <h1>Purpose: </h1>
      <p> Teach users to solve simple deductive logic puzzles (e.g. “Who owns the zebra?”–style grid puzzles) by presenting a series of clues, gathering answers, and adapting difficulty.</p>
      <p>target audience is beginners with no formal logic training,</p>
      <p>core features are user authentication (login), lesson flow, clue presentation, userinput, immediate feedback</p>
      <p>adaptive difficulty based on performance, and performance analytics dashboard</p>
    </div>
  );
}

export default App;
